title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o5550.m30 -> o5560.m22 -> o5550.m30
  o5560.m19 -> o5550.m30 -> o5560.m22 -> o5550.m30
  o5560.m22 -> o5550.m30 -> o5560.m22
  o5560.m22 -> o5579.m30 -> o5560.m22
  o5579.m30 -> o5560.m22 -> o5579.m30

features:
  - inheritance
  - overriding
  - method
  - polymorphism

